const html = $json.data || "";

// remove script and style blocks
let text = html
  .replace(/<script[\s\S]*?<\/script>/gi, "")
  .replace(/<style[\s\S]*?<\/style>/gi, "");

// remove all tags
text = text.replace(/<[^>]+>/g, " ");

// collapse spaces
text = text.replace(/\s+/g, " ").trim();

// keep first 4000 6000 chars for AI so it is not too big
const limited = text.slice(0, 30000);

return [
  {
    json: {
      page_text: limited
    }
  }
];

// 1) Base lead from "dummy data"
const lead = $items('dummy data', 0, 0).json || {};

// 2) LinkedIn profile (single item)
let linkedinProfile = null;
try {
  linkedinProfile = $items('Linkedin Profile', 0, 0).json;
} catch (e) {}

// 3) LinkedIn posts (multiple items)
let linkedinPosts = [];
try {
  linkedinPosts = $items('Linkedin Post Scraper').map(i => i.json);
} catch (e) {}

// 4) Instagram posts (multiple items)
let instagramPosts = [];
try {
  instagramPosts = $items('Instagram Post Scraper').map(i => i.json);
} catch (e) {}

// 5) Website cleaned text
let websiteClean = {};
try {
  websiteClean = $('Get clean the data webiste').first().json.page_text
} catch (e) {
  console.log('Website clean error', e);
}


// 6) Final combined JSON
const combined = {
  // put lead fields on top level
  ...lead,

  // extra blocks grouped
  linkedin_profile: linkedinProfile,
  linkedin_posts: linkedinPosts,
  instagram_posts: instagramPosts,
  website_page_text: websiteClean || null
};

// Return ONE item with ONE JSON
return [
  {
    json: combined,
  },
];
